import { Box2DBodyDef } from "./box2d_body_def";
import { PhysicsWorld } from "../main/physics_world";
import { Box2DBody } from "./box2d_body";
import { b2Body, b2World, b2Vec2, b2ContactListener, b2Shape, b2PolygonShape, b2FixtureDef } from "box2d.package.ts";
import Box2dCollision from "./box2d_collision";
import { BodyTypes } from "../enum/body_types";
import { PhysicsOptions } from "../reference/physics_options";
import IBody from "../interfaces/IBody";
import { Vector2 } from "../../../../utility/math_extended/vector2";
import PhysicsColliderComponent from "../../../../core/components/physics/collision/physics_collider_component";
import { ID } from "../../../../core/data/models/id";
import { Application } from "../../../../../app";

export class Box2DWorld extends PhysicsWorld {
  protected _bodies: Map<number, Box2DBody> = new Map();
  protected _IDs: Map<b2Body, number> = new Map();
  protected _staticBodies: Array<number> = new Array<number>();
  protected _dynamicBodies: Array<number> = new Array<number>();
  protected _kinematicBodies: Array<number> = new Array<number>();
  protected _toDestroy: Array<number> = new Array<number>();
  protected _stepTime: number;
  private _b2world: b2World;

  constructor(gravity: Vector2) {
    super();
    //todo: scale is set to 1, this wil probably have to change
    this._b2world = new b2World(
      new b2Vec2(gravity.x, gravity.y),
      1 //scale
    );

    //copy without reference so we don't have to call the application instance all the time
    this._stepTime = Application.instance.SECONDS_PER_FIXED_UPDATE;

    this.InitWorld();
  }

  public InitWorld() {
    this._b2world.SetContinuousPhysics(true);
    this._b2world.SetWarmStarting(true);
    let contactListener = new b2ContactListener();
    contactListener.BeginContact = contact => {
      let bodyA = contact
        .GetFixtureA()
        .GetBody()
        .GetUserData() as Box2DBody;
      let bodyB = contact
        .GetFixtureB()
        .GetBody()
        .GetUserData() as Box2DBody;
      let contactPoints: Vector2[] = [];
      contact.GetManifold().points.forEach(value => {
        contactPoints.push(new Vector2(value.localPoint.x, value.localPoint.y));
      });
      let collisionB = new Box2dCollision(bodyA, bodyA.gameObject, bodyA.ID, contactPoints);
      let collisionA = new Box2dCollision(bodyB, bodyB.gameObject, bodyB.ID, contactPoints);


      bodyA.OnCollision.dispatch(collisionA);
      bodyB.OnCollision.dispatch(collisionB);
    };
    this._b2world.SetContactListener(contactListener);
  }

  //todo throw correct errors
  public CreateBody(bodyType: BodyTypes, collider: PhysicsColliderComponent, options: PhysicsOptions): Box2DBody {
    //create body def
    let shape = collider.mesh;
    let position = collider.gameObject.transform.position;

    let bodyDef = new Box2DBodyDef(bodyType, position, options);
    let box2DShapes = Array<b2Shape>(shape.PointSets.length);
    let b2Body = this._b2world.CreateBody(bodyDef.box2DBodyDef);

    //create b2Body
    //create box2D shapes
    for (let i = 0; i < shape.PointSets.length; i++) {
      let b2Shape = new b2PolygonShape();
      let polygon = shape.GetScaledPoints(collider.gameObject.transform.scale)[i];
      b2Shape.Set(polygon);
      box2DShapes[i] = b2Shape;
    }

    //create box2D fixtures
    for (let i = 0; i < box2DShapes.length; i++) {
      let fixture = new b2FixtureDef();
      fixture.shape = box2DShapes[i];
      fixture.density = options.densityValues[i];
      fixture.friction = options.frictionValues[i];
      fixture.restitution = options.resitutionValues[i];
      b2Body.CreateFixture(fixture);
    }

    //make Box2DBody
    let body = new Box2DBody(b2Body, new ID().ID, bodyType);

    //add Box2DBody to bodies
    this._bodies.set(body.ID, body);
    body.gameObject = collider.gameObject;

    if (bodyType == BodyTypes.STATIC) this._staticBodies.push(body.ID);
    if (bodyType == BodyTypes.KINEMATIC) this._kinematicBodies.push(body.ID);
    if (bodyType == BodyTypes.DYNAMIC) this._dynamicBodies.push(body.ID);

    return this._bodies.get(body.ID) as Box2DBody;
  }

  public GetBodyByID(ID: number): Box2DBody {
    let body: Box2DBody | undefined = this._bodies.get(ID);
    if (body instanceof Box2DBody) return body;
    throw new Error('No body found with that ID');
  }

  public RemoveBodyFromWorldByBody(body: IBody): void {
    this._toDestroy.push(body.ID);
  }

  public RemoveBodyFromWorldByID(ID: number): void {
    this._toDestroy.push(ID);
  }

  protected Step() {
    //todo research values
    this._b2world.Step(this._stepTime, 8, 3);
  }

  protected DestroyQueuedBodies(): void {
    this._toDestroy.forEach(ID => {
      let body = this._bodies.get(ID);
      if (body instanceof Box2DBody) {
        if (body.bodyType == BodyTypes.STATIC) this._staticBodies.splice(this._staticBodies.indexOf(ID));
        if (body.bodyType == BodyTypes.KINEMATIC) this._kinematicBodies.splice(this._kinematicBodies.indexOf(ID));
        if (body.bodyType == BodyTypes.DYNAMIC) this._dynamicBodies.splice(this._dynamicBodies.indexOf(ID));

        body.Destroy(this._b2world);

        this._bodies.delete(body.ID);
      }
    });

    this._toDestroy = new Array<number>();
  }
}
